-- "corporation" 테이블이 이미 존재하면 삭제
DROP TABLE IF EXISTS corporation;

-- "corporation" 테이블 생성
CREATE TABLE corporation (
    corporation_id INT(11) PRIMARY KEY,
    industry_id INT(11),
    corporation_code INT(50),
    name VARCHAR(255),
    activity_rank INT(11),
    growth_rank INT(11),
    profitability_rank INT(11),
    stability_rank INT(11),
    total_rank DECIMAL(5,2)
);

